import React from 'react';
import Navbar from './Components/Navbar';  // Import Navbar component
import Hero from './Components/Hero'; // Import the Hero component
import './App.css'; // Import global styles

const App = () => {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      {/* About Section */}
      <section id="about" className="section">
        <h1>About</h1>
        <p>Learn more about our mission, vision, and the team driving our success.</p>
      </section>

      {/* Projects Section */}
      <section id="projects" className="section">
        <h1>Projects</h1>
        <p>Discover our portfolio and explore the projects we have worked on.</p>
      </section>

      {/* Contact Section */}
      <section id="contact" className="section">
        <h1>Contact</h1>
        <p>Get in touch with us via email or through our social media channels.</p>
      </section>
    </div>
  );
};

export default App;
